import React from 'react';
import {InputGroup, Button,Input, InputGroupAddon} from 'reactstrap';



const search_input = (props) => {

	const srch = {
		width:"70%"
	}
	return (
		<InputGroup style={srch}>
        <Input style={srch}></Input><InputGroupAddon addonType="append"><Button>I'm a button</Button></InputGroupAddon>
      </InputGroup>
		);
}

export default search_input;
